import React, { Component } from 'react'
import Logo from '../UI/Logo/Logo'
import classes from '/Logo.scss'


export default class Navigation extends Component {
    render() {
        return (
            <nav className="navigation">
                <div className="row">
                    <Logo></Logo>
                </div>               
            </nav>
        )
    }
}
